GTEST_TEST(LTRFile, getLetterCount) {
	Common::MemoryReadStream *stream = new Common::MemoryReadStream(kLTRFile);
	const Aurora::LTRFile ltr(*stream);

	EXPECT_EQ(ltr.getLetterCount(), 28);

	delete stream;
}

GTEST_TEST(LTRFile, generateRandomName) {
	Common::MemoryReadStream *stream = new Common::MemoryReadStream(kLTRFile);
	const Aurora::LTRFile ltr(*stream);

	EXPECT_STREQ(ltr.generateRandomName(4).c_str(), "Name");
	EXPECT_THROW(ltr.generateRandomName(3), Common::Exception);

	delete stream;
}
